import { useNavigation, useRoute } from '@react-navigation/native';
import { Text } from 'react-native';

export default function Reload(){
    const navigation=useNavigation();
    navigation.goBack();
    const load=()=>{
        navigation.goBack();
    }
    return(
        <Text onPress={load}>Loading</Text>
    )
}
